pragma solidity ^0.4.18;

import "../proxy/TokenBaseProxy.sol";

contract TokenBAE is TokenBaseProxy {
	event __newToken(uint256 ref, address adr);
	function TokenBAE(uint256 ref, address multisig, address acc, uint256 initAmount, uint256 _price, uint256 _sellAmount) TokenBaseProxy(multisig, acc, initAmount, _price, _sellAmount) public {
		__newToken(ref, this);
	}
}
